script: |
  super -f text -I q320.spq | sort > q320.out

inputs:
  - name: q320.spq
    data: |
      SELECT - - 88 * col2 + + col0 * - col2 + - cor0.col2 * + col1 * - ( col1 ) FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q320.out
    data: |
      246180
      678960
      9462
